import React from 'react';
import { useParams } from "react-router";
import EventSingle from './Components/eventsingle';

function EventDetails() {

    const { slug } = useParams();
    console.log(slug);

    return (
        <div>
            Event UUID: {slug}
            <EventSingle />
        </div>
    );
}

export default EventDetails;
